import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button'; 

function App() {
  return (
    <div className="App">
      <h1>Welcome React</h1>
      <button>Simple Button</button>
      <Button>Bootstrap Button</Button>
      <Button variant="primary">Primary</Button>
    </div>
  );
}

export default App;
